def character_table(tree):
    order = sorted(tree[:-1].replace('(','').replace(')','').split(","))
    out={}
    for i in range(len(tree)-2):
        if tree[i] == ")":
            c=0
            for j in range(i-1, -1, -1):
                if tree[j] == ")":
                    c+=1
                elif tree[j] == "(":
                    if c > 0:
                        c-=1
                    else:
                        out[tree[j+1:i]] = tree[:j] + tree[i+2:-1]
                        break
    table=[]
    for k, n in out.items():
        k1 = k.replace('(','').replace(')','').split(",")
        n1 = n.replace('(','').replace(')','').split(",")
        character = ''
        for o in order:
            if o in k1:
                character += '1'
            elif o in n1:
                character += '0'
        if character.count('0') > 1 and character.count('1') > 1:
            table.append(character)
    return table

